  (function($){
    var $window = $(window);
    var $body = $('body');
    var $nav = $('#nav__cybergrx__sticky');
    var latestY = 0;

    $nav.measure = {
      top:  $nav.offset().top,
      deltaTop: function() {
        var t = $nav.offset().top;
        return t;
      },
      height: $nav.outerHeight(),
      deltaHeight: function() {
        var h = $nav.offset().top;
        return h;
      },
    };

    $nav.status = {
      sticky: false,
      isMobile: function() {
        if ($(window).width() <= 768) {
          return true;
        } else {
          return false;
        }
      }
    };

    $nav.make = {
      sticky: function() {
        $nav.addClass('stuck');
      },
      unsticky: function() {
        $nav.removeClass('stuck');
      }
    }

    $window.on('resize', function() {
      $nav.measure.top = $nav.measure.deltaTop();
      $nav.measure.height = $nav.measure.deltaHeight();
    });

    $window.on('scroll', function() {
      latestY = $(this).scrollTop();
      if (latestY >= $nav.measure.top) {
        $nav.status.sticky = true;
        $nav.make.sticky();
        // $body.css({
        //   'padding-top': $nav.measure.height + 'px'
        // });
      } else {
        $nav.status.sticky = false;
        $nav.make.unsticky();
        // $body.css({
        //   'padding-top': 0 + 'px'
        // });
      }
    });

  })(jQuery);


